import planB from "./plan_b.json";
import logo from './bilder/logo.png';
import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEyeSlash, faEye } from '@fortawesome/free-solid-svg-icons';
import React, { useState } from 'react';
const MongoClient = require('mongodb').MongoClient;
const uri = "mongodb+srv://admin:BSYNjSs7vQBJU3aJ@aarsoppgave.e8xq6g5.mongodb.net/?retryWrites=true&w=majority";


/*
collection.insertOne({ name: "John", age: 30 }, function(err, result) {
  if (err) throw err;
  console.log("1 document inserted");
});

*/

const App = () => {
  const [aktivSide, setAktivSide] = useState('LoggInn');
  
  MongoClient.connect(uri, function(err, client) {
    if (err) throw err;
    const collection = client.db("test").collection("devices");
    client.close();
  });
  

  const LoggInn = () => {
    return (
      <>
        <h1>Logg inn</h1>
        <input type="text" placeholder="brukernavn" className="input_text"></input>
        <div className="passord">
          <input type="password" placeholder="passord" className="input_text"></input>
          <FontAwesomeIcon className="eye_icon" id="eye_icon1" />
        </div>
        <p id="passordTekst">tom</p>
        <div className="knapper">
          <button className="knapper_login">
            <p>Logg Inn</p>
          </button>
          <button
            onClick={() => setAktivSide('RegistrerBruker')}
            className="knapper_login"
          >
            <p>Registrer deg</p>
          </button>
        </div>
      </>
    );
  };

  const RegistrerBruker = () => {
    return (
      <>
        <h1>Registrer Bruker</h1>
        <input type="text" placeholder="brukernavn" className="input_text"></input>
        <div className="passord">
          <input type="password" placeholder="passord" className="input_text"></input>
          <FontAwesomeIcon className="eye_icon" id="eye_icon1" />
        </div>
        <input type="password" placeholder="bekreft passord" className="input_text"></input>
        <p id="passordTekst">tom</p>
        <div className="knapper">
          <button className="knapper_login" onClick={() => setAktivSide('LoggInn')}>
            <p>Tilbake Til Logg Inn</p>
          </button>
          <button
            onClick={() => setAktivSide('LoggInn')}
            className="knapper_login"
          >
            <p>Registrer brukeren</p>
          </button>
        </div>
      </>
    );
  };

  return (
    <div className="App">
      <header className="App-header">
        <div id="topp">
          <img id="logoen" width={300} src={logo}></img>
        </div>
        {aktivSide === 'LoggInn' ? <LoggInn /> : <RegistrerBruker />}
      </header>
    </div>
  );
};

export default App;
